import React from "react";
import './portfolio.css';

const Port = () =>{
    return(
        <section id="portfolio">
            <div>
                <div className="ptitle">
                    <h2>My Portfolio </h2>

                </div>
            </div>
        </section>
    );
}

export default Port;
